			$key1 = PatogenosPeer::getPrimaryKeyHashFromRow($row, 0);
			if (null !== ($obj1 = PatogenosPeer::getInstanceFromPool($key1))) {
				// We no longer rehydrate the object, since this can cause data loss.
				// See http://propel.phpdb.org/trac/ticket/509
				// $obj1->hydrate($row, 0, true); // rehydrate
			} else {
				$cls = PatogenosPeer::getOMClass(false);

				$obj1 = new $cls();
				$obj1->hydrate($row);
				PatogenosPeer::addInstanceToPool($obj1, $key1);
			} // if obj1 already loaded

				// Add objects for joined Resultado rows

				$key2 = ResultadoPeer::getPrimaryKeyHashFromRow($row, $startcol2);
				if ($key2 !== null) {
					$obj2 = ResultadoPeer::getInstanceFromPool($key2);
					if (!$obj2) {
	
						$cls = ResultadoPeer::getOMClass(false);

					$obj2 = new $cls();
					$obj2->hydrate($row, $startcol2);
					ResultadoPeer::addInstanceToPool($obj2, $key2);
				} // if $obj2 already loaded

				// Add the $obj1 (Patogenos) to the collection in $obj2 (Resultado)
				$obj2->addPatogenos($obj1);

			} // if joined row is not null

				// Add objects for joined CampoResultadoPatogeno rows

				$key3 = CampoResultadoPatogenoPeer::getPrimaryKeyHashFromRow($row, $startcol3);
				if ($key3 !== null) {
					$obj3 = CampoResultadoPatogenoPeer::getInstanceFromPool($key3);
					if (!$obj3) {
	
						$cls = CampoResultadoPatogenoPeer::getOMClass(false);

					$obj3 = new $cls();
					$obj3->hydrate($row, $startcol3);
					CampoResultadoPatogenoPeer::addInstanceToPool($obj3, $key3);
				} // if $obj3 already loaded

				// Add the $obj1 (Patogenos) to the collection in $obj3 (CampoResultadoPatogeno)
				$obj3->addPatogenos($obj1);

			} // if joined row is not null

				// Add objects for joined PruebaBioquimica rows

				$key4 = PruebaBioquimicaPeer::getPrimaryKeyHashFromRow($row, $startcol4);
				if ($key4 !== null) {
					$obj4 = PruebaBioquimicaPeer::getInstanceFromPool($key4);
					if (!$obj4) {
	
						$cls = PruebaBioquimicaPeer::getOMClass(false);

					$obj4 = new $cls();
					$obj4->hydrate($row, $startcol4);
					PruebaBioquimicaPeer::addInstanceToPool($obj4, $key4);
				} // if $obj4 already loaded

				// Add the $obj1 (Patogenos) to the collection in $obj4 (PruebaBioquimica)
				$obj4->addPatogenos($obj1);

			} // if joined row is not null

			$results[] = $obj1;
		}
		$stmt->closeCursor();
		return $results;
	}

